import React from "react";

const ProcessDelivery = () => {
  return (
    <div className="container-fluid">
      <div className="row">
        <main
          role="main"
          className="col-md-9 ml-sm-auto col-lg-10 pt-3 px-4"
        >
            <div>Process Delivery</div>
        </main>
      </div>
    </div>
  );
};

export default ProcessDelivery;
